CREATE DEFINER=`root`@`localhost` PROCEDURE `GetDatabaseBestPrice`(
    IN p_productCode VARCHAR(255),
    IN p_accountId VARCHAR(255)
)
BEGIN
    DECLARE v_productId INT;
    DECLARE v_accountId INT;

    -- Get the product ID by the product code
    SELECT id INTO v_productId FROM products WHERE sku = p_productCode;

    -- Get the account ID by external_reference
    SELECT id INTO v_accountId FROM accounts WHERE external_reference = p_accountId;

    -- Logic to retrieve the best price from the prices table
    SELECT * FROM prices
    WHERE product_id = v_productId
        AND (account_id = v_accountId OR account_id IS NULL)
    ORDER BY value
    LIMIT 1;
END ;;
